import { Route, Navigate } from "react-router-dom";
import { isLoggedIn } from "../../common/auth";

function GuestRoute({ path, ...rest }) {
  const { userAuth } = isLoggedIn();
  return !userAuth ? (
    <Route {...rest} />
  ) : (
    <Navigate to={"/406"} replace={false} />
  );
}

export default GuestRoute;
